window.bookSummaryJSON = "<p>Winter has never been so hot, nor the world so dangerous.&nbsp;</p> <p>Sidney Bannister has been lucky so far. With no survival training and no real skills besides her street smarts, she realizes that must learn to fight so she can protect her newborn baby from the infected that plague the United States.&nbsp;</p> <p>Enemies from her former life arise to bring the AWOL Lieutenant Jake Murphy to justice. The hunt intensifies as the remnants of Jake’s old unit close in around him and his group of survivors.&nbsp;</p> <p>In the middle of the chaos, Iranian aircraft fill the skies of Kansas, forcing the Americans to make decisions that will impact all of their lives. How much is Sidney’s small group willing to sacrifice to stay together?&nbsp;</p> <p>Follow the action that began in the Phalanx Press collaborative novel <i>Five Roads to Texa</i>s as the series continues to grow.</p>"; 
